import React from 'react';
import { useState , useEffect} from 'react';

const App = () => {

  var [facList,setFacList] = useState([])

  useEffect(() => {
    fetch("http://localhost:8080/")
    .then(response => response.json())
    .then((data) => setFacList(data))


  },[])

  return (
    <div>

    <table border="2" cellSpacing="0" cellPadding="6">
      <thead>
        <tr>
            <th>Faculty</th>
            <th>Max Entries</th>
        </tr>
      </thead>

      <tbody>
        {facList.map((fac) => <Faculty key={fac._id} name={fac.name} entries={fac.maxEntries} />)}

      </tbody>
    </table>

    </div>
  )
}

const Faculty = (props) => {
  return (
    <tr>
      <th>{props.name}</th>
      <td><input id={props.key} type="text"  defaultValue={props.entries} onChange={() =>{
        console.log("Changed")
      }}></input></td>
    </tr>
  )
}



export default App
